script: |
  super -f text -I q10902.spq | sort > q10902.out

inputs:
  - name: q10902.spq
    data: |
      SELECT ALL - col0 / - col2 - + col1 / col0 FROM tab2 (FORMAT parquet) WHERE NOT NULL NOT BETWEEN ( col0 - col1 * + col2 ) AND col0 + - col1;
  - name: tab2

outputs:
  - name: q10902.out
    data: |
